<HTML>
<HEAD>
<TITLE>らき☆すた OP</TITLE>
<SCRIPT language="JavaScript">

var cnt = 0;                   // 描画フレーム番号
var cnt_= 0;                   // 1ループ前の描画フレーム番号
var dat = new Array(2520);
var fps = 29.970;              // 目標フレームレート
var stime = 0;                 // 開始時刻
var ntime = 0;                 // 現在時刻
var state = 1;                 // 再生状態 (0:再生, 1:停止, 2:一時停止)
var audio;

function Play()
{
    if(state == 1){
        cnt = 0;
        stime = new Date();
        audio.currentTime = 0;
    }
    else if(state == 2){
        stime = new Date() - cnt * 1000 / fps;
    }

    state = 0;
    audio.play();
    Draw();
}

function Pause()
{
    if(state == 0){
        state = 2;
        audio.pause();
    }
}

function Stop()
{
    cnt = 0;
    cnt_ = cnt;
    state = 1;
    ntime = stime;
    audio.pause();
    audio.currentTime = 0;
    DrawMain();
}

function Draw()
{
    ntime = new Date();
    cnt_ = cnt;
    cnt = Math.floor((ntime-stime) * fps / 1000);

    if((cnt >= dat.length) || (state == 1)){
        cnt = 0;
        Pause();
        audio.currentTime = 0;
    }
    else{
        DrawMain();
    }

    if(!state){
        setTimeout("Draw()", 5);
    }
}

function DrawMain()
{
    skip = cnt - cnt_ - 1;
    ptime = Math.floor((ntime - stime) / 1000);
    ttime = Math.floor(dat.length / fps);
    document.all("info_pfrm").innerHTML = (cnt+1);
    document.all("info_tfrm").innerHTML = dat.length;
    document.all("info_ptim").innerHTML = Math.floor(ptime/60) + ":" + (((ptime%60)<10)?"0":"") + (ptime%60);
    document.all("info_ttim").innerHTML = Math.floor(ttime/60) + ":" + (((ttime%60)<10)?"0":"") + (ttime%60);
    document.all("info_skip").innerHTML = ((skip>0)?skip:0);

    document.all("canvas").innerHTML = "<PRE>" + dat[cnt] + "</PRE>";
}

window.onload = function() {
    audio = document.getElementById('audio');
    DrawMain();
};


</SCRIPT>
